  })
  .add('Baobab.Cursor#set', function() {
    cursor.set({ d: { e: { f: { g: [] } } } });
    cursor.set(['d', 'e', 'f', 'foo'], 'bar');
  })
  .add('Baobab.Cursor#unset', function() {
    cursor.unset(['d', 'e', 'f', 'foo']);
  })
  .add('Baobab.Cursor#push', function() {
