  })
  .add('Baobab.Cursor#unshift', function() {
    cursor.unshift(['d', 'e', 'f', 'g'], 'baobab');
  })
  .add('Baobab.Cursor#splice', function() {
    cursor.splice(['d', 'e', 'f', 'g'], [1, 1, 'baobab']);
  })
  .on('cycle', function(event) {
    console.log(String(event.target));
  })
  .run();

